export const parameters = {
  actions: { argTypesRegex: "^on[A-Z].*" },
  controls: {
    matchers: {
      color: /(background|color)$/i,
      date: /Date$/,
    },
  },
  viewport: {
    viewports: {
      tabletPortrait: {
        name: 'Tablet - Portrait (screen-sm)',
        styles: {
          width: '768px',
          height: '992px',
        },
      },
      tabletLandscape: {
        name: 'Tablet - Landscape (screen-md)',
        styles: {
          width: '992px',
          height: '768px',
        },
      },
      desktop: {
        name: 'Desktop (screen-lg)',
        styles: {
          width: '1200px',
          height: '992px',
        },
      },
    },
  },
  layout: 'centered',
  options: {
    storySort: {
      method: 'alphabetical',
    },
  },
}
